@MichelMelhem Sorry, but I cannot see anything in the gif you posted.

@ipereto Are you using the default Darkula theme? If so, you're not getting proper highlighting. There should be a banner at the top of the Scaffold editor, too. It looks like a configuration issue.

Please append the output of `flutter doctor -v`.

Flutter projects do not need a Java JDK. They do need an Android SDK to run on Android devices, and Xcode for iOS.

@gabrielnemeth What content is in your Dart Analysis window?

For everyone:
The Dart Analysis window has a toolbar on the left. The top icon should be Restart and the second should be a gear for Settings. Click the gear and choose the bottom option: View analyzer diagnostics. That will open up a web page with lots of info. Are there any exceptions listed? Does the status page show a server process ID and analysis server version number? How many contexts exist? Are there any stats listed under code completion?

